import React from "react";
import HeadCell from "./HeadCell/index";

const TableHead = ({ matrix }) => {
   const firstNoneVisibleHead = <HeadCell value={""} />;
   const columnsHead = matrix.map((item, index) => {
      return <HeadCell key={index} value={"col " + index + 1} />;
   });
   const sumHead = <HeadCell value={"Sum"} />;
   const heads = firstNoneVisibleHead.concat(columnsHead).concat(sumHead);

   return (
      <thead>
         <tr>{heads}</tr>
      </thead>
   );
};

export default TableHead;
